from collections import defaultdict
import pandas as pd
import numpy as np
import json

# TODO: Write a version of this code that does not rely on 21J for deciding whether a site is synonymous

'''This script extracts the bat mutation counts from 'results/mutations/{xx}.json' using all branches with a branch 
length smaller than CUTOFF, adds secondary structure information (Huh7), and stores them in 'counts_bat_{
CUTOFF}.csv'.'''


CUTOFF = 1
CLADE = '21J'

# Prepare dictionary for mutation counts
bat_count = defaultdict(int)

# Load boundaries of non-recombinant regions
breakpoints = np.loadtxt('results/breakpoints.txt')

# Load data for synonymous, non-excluded mutations in 21J to add zero counts and check if a mutation is synonymous (
# including those with zero actual counts!)
df_help = pd.read_csv(
    f'/Users/georgangehrn/Desktop/SARS2-mut-fitness-corr/human_data/counts/counts_all_{CLADE}_nonex_syn.csv')

# Keep track of excluded mutations
incl_sites = defaultdict(int)
nt_errors = defaultdict(int)
site_errors = defaultdict(int)
zero_muts = defaultdict(int)

# Clade founder sequence of 21J obtained from human_data/counts.csv (29903 nts)
# TODO: Store the reference sequences in a separate file
clade_founder_21J = ''
wuhan_hu_1 = ''
full_ref_seq = ''

# Maybe exclude branches in the trees which have too many mutations
num_muts_per_branch = defaultdict(int)
branches = {'included': 0, 'excluded': 0}

# Loop through all 27 subregions of the genome
for region in range(27):

    print(f'\nsubregion {region + 1}')

    # Open file with mutation data for that subregion
    with open(f'results/mutations/{region:02d}.json', 'r') as f:
        # f is a dict with keys 'generated_by' ('program': 'augur', 'version': 11.1.2), 'nodes' (internal nodes
        # and leaves), and 'reference' (which is not equal to Wuhan-Hu-1!)
        tree = json.load(f)

        # Quantify agreement between 21J clade founder and reference sequence of this subregion
        ref_seq = tree['reference']['nuc']
        clade_founder = clade_founder_21J[int(breakpoints[region]):int(breakpoints[region + 1])]
        diff_count = np.count_nonzero(np.array(list(ref_seq)) != np.array(list(clade_founder)))
        print(f"no. of positions differing between subregion reference and " + CLADE + " clade founder: "
                                                                                       f"{diff_count}/{len(ref_seq)}")

        # Loop through every node in the tree of that subregion
        subtree = tree['nodes']
        for node in subtree.values():
            num_muts_per_branch[len(node['muts'])] += 1
            if len(node['muts']) / len(ref_seq) <= CUTOFF:
                branches['included'] += 1
                # Loop through every mutation leading to that node from the previous node
                for mut in node['muts']:
                    # XnY refers to a mutation at position n in the subregion -> add previous breakpoint to site
                    mut = mut[0] + str(int(int(mut[1:-1]) + breakpoints[region])) + mut[-1]
                    if mut in df_help['nt_mutation'].values:
                        bat_count[mut] += 1
                        incl_sites[mut[1:-1]] += 1
                    # else:
                    #     if mut[1:-1] in df_help['nt_mutation'].str[1:-1]:
                    #         nt_errors[mut[1:-1]] += 1
                    #     else:
                    #         site_errors[mut[1:-1]] += 1
            else:
                branches['excluded'] += 1

        # Add reference sequence of subregion to full reference
        full_ref_seq += ref_seq

print(np.sum(list(bat_count.values())))
print('\nNo. of diff. incl. sites: ' + str(len(incl_sites)) + ' (avg. mut. counts.: ' + str(
    np.average(list(incl_sites.values()))) + ')')
print('No. of diff. nt. errs.: ' + str(len(nt_errors)) + (' (avg. mut. counts.: ' + str(
    np.average(list(nt_errors.values()))) + ')' if len(nt_errors) > 0 else ''))
print('No. of diff. site errs.: ' + str(len(site_errors)) + ' (avg. mut. counts.: ' + str(
    np.average(list(site_errors.values()))) + ')')
print(f'With a cutoff of {CUTOFF}, {branches["excluded"]}/{branches["excluded"] + branches["included"]}'
      f' branches are removed.')

# Add a zero count for all non-excluded, synonymous mutations in 21J data that agree in their ancestral nt
for mut in df_help['nt_mutation']:
    if full_ref_seq[int(mut[1:-1]) - 1] == mut[0]:
        bat_count[mut] += 0
        zero_muts[mut] += 1

print('No. of added zero count mutations: ' + str(len(zero_muts)))

# Create pandas dataframe
d = {'nt_mutation': bat_count.keys(), 'actual_count': bat_count.values()}
df = pd.DataFrame(data=d)
df['nt_site'] = df['nt_mutation'].apply(lambda x: int(x[1:-1]))
df['clade_founder_nt'] = df['nt_mutation'].apply(lambda x: x[0])
df = df.sort_values('nt_site')

# Add secondary structure information (no exclusion of sites based on nt differences)
df = pd.merge(df, df_help[['nt_mutation', 'unpaired']], on='nt_mutation', how='left')

# Save as new csv file
df.to_csv('mut_counts_bat.csv', index=False, header=True)
